Teaser:
Voer uw C/C++-programma's uit in ChATGPT met behulp van deze prompt. Dit is een zeer krachtige prompt om allerlei codeertalen rechtstreeks in uw webbrowser uit te voeren met behulp van Chatgpt.

 Typ gewoon uw C- of C++-code die u wilt uitvoeren in de prompt en Chat-GPT geeft u de uitvoer van dat programma als reactie.

 Dit is handig als u geen compiler op uw pc hebt geïnstalleerd en u wat code wilt testen, u kunt dit nu eenvoudig doen.

 Voorbeeld voor C++-code.
 #include <Istream>

 int hoofd() {
  std::cout << "Hallo chat-gpt3" << std::endl;
  geef 0 terug;
 }
